import React from 'react';

const ImgaeList = ({images}) => {
    console.log(images);
    return (
        <div className="fontifyr">
            {
               images.map((m)=>{
                   return (<img src={m.urls.regular}/>);
                   }
               )
            }
        </div>
    );
};

export default ImgaeList;
